drop table if exists #base 

select 
id
, direction = left(msg, 1)
, moves = cast(SUBSTRING(msg, 2,  len(msg)) as int)
into #base 
from #msg 


; with cte as 
(select id, direction, moves, loc = (50 + iif(direction = 'L', -moves, moves) % 100 + 100 ) % 100
from #base where id = 1  
union all
select b.id, b.direction, b.moves, loc = (c.loc + iif(b.direction = 'L', -b.moves, b.moves) % 100 + 100 ) % 100
from cte c inner join #base b 
on c.id = b.id -1 
)
select ans = count(*) from cte  where loc = 0 
option (maxrecursion 0  )



---part 2


drop table if exists #rpt

; with cte as 
(select id
, direction
, moves
, loc = (50 + iif(direction = 'L', -moves, moves) % 100 + 100 ) % 100
, zero_clicks = floor( abs(moves) / 100 )  -- counts how many full laps
                + 
                case when direction = 'R' and (50 + (moves % 100)) >= 100  then 1
                     when direction = 'L' and (50 - (moves % 100)) <= 0 then 1 
                     else 0 
                end
from #base where id = 1  

union all

select 
b.id
, b.direction
, b.moves
, loc = (c.loc + iif(b.direction = 'L', -b.moves, b.moves) % 100 + 100 ) % 100
, zero_clicks = floor( abs(b.moves) / 100 )  -- counts how many full laps + if the next move will hit 0
                + 
                case when c.loc != 0 and b.direction = 'R' and (c.loc + (b.moves % 100)) >= 100 then 1
                     when c.loc != 0 and b.direction = 'L' and (c.loc - (b.moves % 100)) <= 0 then 1 
                     else 0 
                end

from cte c inner join #base b 
on b.id = c.id + 1
)
select * into #rpt from cte --  where loc = 0 
option (maxrecursion 0  )


select ans = sum(zero_clicks) from #rpt 


